import React from 'react';

const SkillIcon = ({ skill, color }) => {
	return (
		<div
			className="skill-icon"
			style={{
				backgroundColor: color,
				width: '3em',
				height: '1em',
				borderRadius: '0.5em',
			}}
		>
			{skill}
		</div>
	);
};

export default SkillIcon;
